          <span className="postCat">Entertainment</span>
          <span className="postCat">Personal Experience</span>
        </div>
        <span className="postTitle">Lorem ipsum dolor sit amet</span>
        <hr />
        <span className="postDate">1 Hour ago</span>
      </div>
    </div>
  );
}
